<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <title>Title</title>
</head>
<body>
<script>
    let A = [7, 2, 5, 3, 5, 3]
    let B = [7, 2, 5, 4, 6, 3, 5, 3]
    let C = []
    for (let i = 0; i < B.length; i++) {
        let isContain = false;
        for (let j = 0; j < A.length; j++) {
            if (B[i] === A[j]) {
                isContain = true;
                break;
            }
        }
        if (!isContain) {
            C.push(B[i]);
        }
    }
    alert(C)
</script>
</body>
</html>
